package leetcode.findallanagrams

import org.amshove.kluent.shouldBeEmpty
import org.amshove.kluent.shouldContainAll
import org.amshove.kluent.shouldNotBeEmpty
import org.junit.Test

class SolutionTest {
  @Test
  fun test() {
    Solution().findAnagrams("abc", "bac")
        .shouldContainAll(listOf(0))

    Solution().findAnagrams("abab", "ab")
        .shouldContainAll(listOf(0, 1, 2))
    Solution().findAnagrams("ab", "abc")
        .shouldBeEmpty()
    Solution().findAnagrams("aa", "bb")
        .shouldBeEmpty()
  }

  @Test
  fun test2() {
    Solution().findAnagrams("cbaebabacd", "abc")
        .shouldContainAll(listOf(0, 6))
  }

  @Test
  fun caseOfTLE() {
    Solution().findAnagrams("",
        "")
        .shouldNotBeEmpty()
  }
}
